import LogItem from './Logitem/LogItem'
import './Logs.css'
const Logs = ()=>{
     // 模拟一组从服务器中加载的数据
     const logsData = [
        {
            id: '001',
            date: new Date(2021, 1, 20, 18, 30),
            desc: '学习九阳神功',
            time: 30
        },
        {
            id: '002',
            date: new Date(2022, 2, 10, 12, 30),
            desc: '学习降龙十八掌',
            time: 20
        },
        {
            id: '003',
            date: new Date(2022, 2, 11, 11, 30),
            desc: '学习JavaScript',
            time: 40
        },
        {
            id: '004',
            date: new Date(2022, 2, 15, 10, 30),
            desc: '学习React',
            time: 80
        }
    ];
    const logItemDate = logsData.map(item=><LogItem date={item.date} desc={item.desc} time/>)
return <div className='logs'>
    <LogItem Date = {new Date(2021,7,20,19,0)} desc={'学习react'} time={'50'}/>
    <LogItem Date = {new Date(2022,3,12,10,10)} desc={'学习Vue'} time={'40'}/>
    <LogItem Date = {new Date(2020,6,16,18,20)}desc={'学习promise'} time={'30'}/>
    </div>

}
export default Logs
